import React from 'react';
import { FaEnvelope, FaAddressBook, FaLinkedin, FaGithub } from 'react-icons/fa';

const Footer = () => {
  return (
    <footer className="footer-main fixed-bottom" style={{ padding: '10px 0', backgroundColor: '#343a40', color: '#fff' }}>
      <div className="container">
        <div className="row align-items-center">
          <div className="col-lg-4 col-sm-12 col-xs-12">
            <div className="address-box clearfix">
              <div className="add-icon">
                <img src="Img/footer-icon-01.png" alt="" />
              </div>
            </div>
          </div>
          <div className="col-lg-8 col-sm-12 col-xs-12">
            <div className="text-left m-50">
              Created By Amit Kumar &nbsp;|&nbsp;
              <a href="mailto:amitkumar823906@gmail.com" style={{ color: '#fff', textDecoration: 'none' }}><FaEnvelope /></a> &nbsp;
              <a href="https://www.crio.do/learn/portfolio/amitkumar823906/" style={{ color: '#fff', textDecoration: 'none' }}><FaAddressBook /></a> &nbsp;
              <a href="https://www.linkedin.com/in/amit-kumar-522180201/" style={{ color: '#fff', textDecoration: 'none' }}><FaLinkedin /></a> &nbsp;
              <a href="https://github.com/Amitbabu123" style={{ color: '#fff', textDecoration: 'none' }}><FaGithub /></a>
            </div>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
